  };

  handleDelete = movie => {};

  render() {
    return (
      <div>
        {"Showing movies .... "}
        {movies.map(movie => (
          <Movie key={counter.id} onDelete={onDelete} movie={movie} />
        ))}
      </div>
    );
  }
}

